import React from 'react';

const Leftnav = ({setBenefits}) => {

    handleClick = () =>{
        setBenefits(true)
    }

    return (
        <div className='left-nav'>
            <div onClick={handleClick()}>
                1
            </div>
            <div>
                2
            </div>
            <div>
                3
            </div>
        </div>
    )
}
export default Leftnav;
